# # Introduction
# 
# When data scientists may come across a new classification problem, the first algorithm that may come across their mind is Logistic Regression. It is a supervised learning classification algorithm which is used to predict observations to a discrete set of classes. 
# 
# Logistic Regression is a fundamental and widely used algorithm in the field of machine learning, particularly for binary classification problems. Despite its name, logistic regression is used for classification, not regression. 
# It's a supervised learning algorithm that predicts the probability of an instance belonging to a particular class.
# 
# Logistic regression is primarily designed for binary classification tasks where the target variable has two classes, often labeled as 0 and 1. Examples include spam or not spam, fraud or not fraud, etc.Unlike linear regression, which predicts continuous values, logistic regression models the probability of an instance belonging to a certain class. This model leverages the logistic (or sigmoid) function to transform real-valued inputs into a probability range of [0, 1] .
# 
# The sigmoid function's characteristic S-shaped curve ensures that the output remains bounded, facilitating a clear interpretation of class probabilities. 
# In contrast to linear regression, logistic regression does not predict continuous values but focuses on estimating the likelihood of an instance belonging to a particular class. The training process involves maximizing the likelihood of observing the given outcomes under the assumed logistic distribution, achieved through techniques like maximum likelihood estimation.
# It is one of the most simple, straightforward and versatile classification algorithms which is used to solve classification problems.
# 
# Here are some more examples where to apply logistic regression:
